<p style="outline: none; margin: 1.2em 0px; text-align: center;"><span style="font-family: 'trebuchet ms', geneva; font-size: medium;">Команды проводят &laquo;сдвоенные игры&raquo; по круговой системе разъездами в два круга. Если команда в первом круге играла &laquo;дома&raquo; (первая команда в расписании игр), то ответные 2 игры второго круга она играет в &laquo;гостях&raquo;, и наоборот, если первые игры первого круга она играла в &laquo;гостях&raquo;, то ответные игры второго круга она будет играть &laquo;дома&raquo;. Каждая команда должна сыграть по 16 игр.</span></p>
